INSERT INTO `movie` (`id`, `title`, `eng_title`, `genre`, `age`, `director`, `running_time`, `information`, `release`, `country`, `language`)
VALUES
	(1,'싱크홀','SINKHOLE','Comedy','12세','김지훈',114,'사.상.초.유! 도심 속 초대형 재난 발생! 지하 500m 싱크홀 속으로 떨어진 이들은 과연 무사히 빠져나갈 수 있을까?','2021-08-11','대한민국','한글'),
	(2,'남산의 부장들','The Man Standing Next','Drama','15세','우민호',113,'각하 제가 어떻게 하길 원하십니까 1979년 10월 26일 중앙정보부장 김규평(이병헌)이 대한민국 대통령을 암살한다. 흔들린 충성 그 날의 총성','2020-01-22','대한민국','한글'),
	(3,'극한직업','Extreme Job','Comedy','15세','이병헌',111,'낮에는 치킨장사! 밤에는 잠복근무! 지금까지 이런 수사는 없었다! 수사는 뒷전, 치킨장사로 눈코 뜰 새 없이 바빠진 마약반에게 어느 날 절호의 기회가 찾아오는데… 범인을 잡을 것인가, 닭을 잡을 것인가! 2019년 새해, 출동!','2019-01-23','대한민국','한글'),
	(4,'엑시트','EXIT','Comedy','12세','이상근',103,'짠내 폭발 청년백수, 전대미문의 진짜 재난을 만나다! 칠순 잔치가 무르익던 중 의문의 연기가 빌딩에서 피어 오르며 피할 새도 없이 순식간에 도심 전체는 유독가스로 뒤덮여 일대혼란에 휩싸이게 된다. 용남과 의주는 산악 동아리 시절 쌓아 뒀던 모든 체력과 스킬을 동원해 탈출을 향한 기지를 발휘하기 시작하는데…','2019-07-31','대한민국','한글'),
	(5,'신과함께-인과 연','Along with the Gods The Last 49 Days','fantasy','12세','김용화',141,'천 년 동안 48명의 망자를 환생시킨 저승 삼차사 한 명만 더 환생시키면 그들도 새로운 삶을 얻을 수 있다. 하지만 강림은 원귀였던 수홍을 자신들의 마지막 귀인으로 정하는 이해할 수 없는 선택을 한다. 이승과 저승 현재와 과거를 오가는 천 년의 비밀이 밝혀진다','2018-08-01','대한민국','한글'),
	(6,'완벽한 타인','Intimate Strangers','Drama','15세','이재규',115,'우리 게임 한 번 해볼까? 다들 핸드폰 올려봐 저녁 먹는 동안 오는 모든 걸 공유하는 거야 전화, 문자, 카톡, 이메일 할 것 없이 싹! 흔쾌히 게임을 시작하게 된 이들의 비밀이 핸드폰을 통해 들통나면서 처음 게임을 제안했던 것과는 전혀 다른 상상치 못한 결말로 흘러가는데…. 상상한 모든 예측이 빗나간다!','2018-10-31','대한민국','한글'),
	(7,'1987','1987','Drama','15세','장준환',129,'책상을 탁 치니 억 하고 죽었습니다 1987년 1월 경찰 조사를 받던 스물두 살 대학생이 사망한다. 한 사람이 죽고, 모든 것이 변화하기 시작했다. 모두가 뜨거웠던 1987년의 이야기.','2017-12-27','대한민국','한글');
